export default (function(a,b,c,d,e,f,g,h){return {data:{fMzyKKUosl:{data:{id:1071,attributes:{imdbId:"tt0120669",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNjA2ZDY3ZjYtZmNiMC00MDU5LTgxMWEtNzk1YmI3NzdkMTU0XkEyXkFqcGdeQXVyNjQyMjcwNDM@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"7.6\u002F10"},{Source:"Rotten Tomatoes",Value:"50%"},{Source:"Metacritic",Value:"41\u002F100"}],item_lang:{data:{id:1734,attributes:{title:c,plot:"The big-screen version of Hunter S. Thompson's seminal psychedelic classic about his road trip across Western America as he and his large Samoan lawyer searched desperately for the \"American dream\"... they were helped in large part by the huge amount of drugs and alcohol kept in their convertible, The Red Shark.",slug:"fear-and-loathing-in-las-vegas"}}},books:{data:[{id:6165,attributes:{title:c,description:d,thumbnail:e,authors:[a],firstBook:true,published:f,publisher:g,subtitle:h}},{id:6166,attributes:{title:c,description:d,thumbnail:e,authors:[a],firstBook:b,published:f,publisher:g,subtitle:h}},{id:6167,attributes:{title:"The Great Shark Hunt",description:"Brings together a selection of the legendary American journalist's articles on subjects ranging from the Super Bowl to Watergate, from Hemingway to Brando, and from sharks to drugs.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=tESC9BnR85cC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:b,published:"2003-11-06",publisher:"Simon and Schuster",subtitle:"Strange Tales from a Strange Time"}},{id:6168,attributes:{title:"Conversations with Hunter S. Thompson",description:"This compilation of selected personal interviews traces the trajectory of Thompson's prolific and much-publicized career. These engaging exchanges reveal his determination, self-indulgence, energy, outrageous wit, ire, and passions, as he discusses his life and work.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=I5n2h7E0O3wC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:b,published:"2008-01-01",publisher:"Univ. Press of Mississippi",subtitle:""}},{id:6169,attributes:{title:"Hunter S. Thompson: The Last Interview",description:"Hunter S. Thompson was so outside the box, a new word was invented just to define him: Gonzo. He was a journalist who mocked all the rules, a hell-bent fellow who loved to stomp on his own accelerator, the writer every other writer tried to imitate. In these brutally candid and very funny interviews that range across his fabled career, Thompson reveals himself as mad for politics, which he thought was both the source of the country’s despair and, just maybe, the answer to it. At a moment when politics is once again roiling America, we need Thompson’s guts and wild wisdom more than ever.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=0CHXDgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:b,published:"2018-02-06",publisher:"Melville House",subtitle:"and Other Conversations"}}]}}},meta:{}}},prerenderedAt:1680940968559}}("Hunter S. Thompson",null,"Fear and Loathing in Las Vegas","50th Anniversary Edition • With an introduction by Caity Weaver, acclaimed New York Times journalist This cult classic of gonzo journalism is the best chronicle of drug-soaked, addle-brained, rollicking good times ever committed to the printed page. It is also the tale of a long weekend road trip that has gone down in the annals of American pop culture as one of the strangest journeys ever undertaken. Also a major motion picture directed by Terry Gilliam, starring Johnny Depp and Benicio del Toro.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=R11qaqN4jzQC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2010-09-29","Vintage","A Savage Journey to the Heart of the American Dream"))